import React, { Component } from "react";
import lehigh from "../images/lehigh.png";

class Education extends Component {
  state = {};
  render() {
    return (
      <div>
        <img src={lehigh} alt="Lehigh University"></img>
      </div>
    );
  }
}

export default Education;
